"use strict";

document.addEventListener("DOMContentLoaded", function () {
  !function () {
    for (var t = document.getElementById("navList").children, e = 0; e < t.length; e++) {
      var s = t[e];
      s.addEventListener("mouseenter", function (t) {
        this.firstChild;
        var e = this.lastChild;
        e.classList.add("fadeOut"), e.classList.remove("fadeIn");
      }, !1), s.addEventListener("mouseleave", function (t) {
        this.firstChild;
        var e = this.lastChild;
        e.classList.remove("fadeOut"), e.classList.add("fadeIn");
      }, !1);
    }
  }();
}, !1);